webpackJsonp([0x98b5d4c95f40],{4160:function(t,a){t.exports={data:{markdownRemark:{html:'<p><img src="http://thg.danmaq.com/image/ss/thG_02_s.jpg" alt="クリックすると詳細を閲覧できます。"></p>\n<p>同人用というより技術検証用に制作した<em>東方の世界観を使った半アクションRPG</em>です。</p>\n<p>テイルズみたいにハッキリARPGと言い切る程アクションするわけではないし、かといってFFみたいにコマンド・ターン制みたいなじっくり考えて行動する戦闘形態なRPGでもない(アクティブモードでまともにプレイ出来ないチキン野郎でごめんね)ので半アクションRPGです。</p>\n<p>主人公はオリジナルキャラ……と言うかプレイヤー自身です。おなじみのヒロインたちは郷の住人として登場し、協力してくれたりくれなかったりします。彼女らはいつも気まぐれなので。幻想郷は少なくとも今のところはすっごい平和だし。</p>\n<ul>\n<li>ジャンル: RPG</li>\n<li>使用言語: VisualC++.net2003</li>\n<li><a href="http://thg.danmaq.com/">thG(仮称)特設ページへ行く</a></li>\n<li>現在制作半凍結中</li>\n</ul>',frontmatter:{cover:null,date:"2008-02-01T00:00:00+09:00",strDate:"2008/1/31",title:"thG(仮称)"}}},pathContext:{path:"/ja/blog/2008/02/01-thg%e4%bb%ae%e7%a7%b0/",langKey:"ja"}}}});
